import React, {useState} from 'react';
import {
  SafeAreaView,
  ScrollView,
  Text,
  View,
  Alert,
  StyleSheet,
  Button,
} from 'react-native';

import {enhetApi} from './api';


type MyProps = {
  // using `interface` is also ok
  message: string;
};
type MyState = {
  grunnskole: {},
  vgs: {},
};
class Data extends React.Component<MyProps, MyState> {

  state: MyState = {
    // optional second annotation for better type inference
    grunnskole: {},
    vgs: {},
  };

  componentDidMount = async () => {
    try {
      const fetchedgrunnskole = await enhetApi.getEnheterWithSkolekategori('1');
      this.setState({grunnskole: fetchedgrunnskole.data});
    } catch (error) {
      console.warn(error)
      Alert.alert('An error occurred');
    }

    try {
      const fetchedvgs = await enhetApi.getEnheterWithSkolekategori('2');
      this.setState({vgs: fetchedvgs.data});
    } catch (error) {
      console.warn(error)
      Alert.alert('An error occurred');
    }
  }


  render() {
    return (
      <div>
        {this.props.message} {this.state.vgs}
      </div>
    );
  }
}




